import random

class Solution:
    def findUnsortedSubarray(self, nums):
        mi, mx = float('inf'), float('-inf')
        l = r = -1
        n = len(nums)
        for i, x in enumerate(nums):
            if mx > x:
                r = i
            else:
                mx = x
            if mi < nums[n - i - 1]:
                l = n - i - 1
            else:
                mi = nums[n - i - 1]
        return 0 if r == -1 else r - l + 1

def generate_test_case():
    solution = Solution()

    # Generate random numbers list
    nums = random.sample(range(-100000, 100001), random.randint(1, 10001))

    # Calculate the expected result using the provided Solution class
    expected_result = solution.findUnsortedSubarray(nums)

    return nums, expected_result

def test_generated_test_cases(num_tests):
    test_case_generator_results = []
    for i in range(num_tests):
        nums, expected_result = generate_test_case()
        solution = Solution()
        assert solution.findUnsortedSubarray(nums) == expected_result
        test_case = f"assert solution.findUnsortedSubarray({nums}) == {expected_result}"
        test_case_generator_results.append(test_case)
    return test_case_generator_results

if __name__ == "__main__":
    num_tests = 100  # You can change this to generate more test cases
    test_case_generator_results = test_generated_test_cases(num_tests)
